import React from 'react';
import {StyleSheet} from 'react-native';

export default StyleSheet.create({

    header:{
        backgroundColor: 'white',
        width: '100%',
        height: '4%',
        marginTop: '4%',
        marginBottom: '5%',
        alignItems: 'center',
        justifyContent: 'center',
    },
    task:{
        width: '90%',
        height: '10%',
        backgroundColor: 'black',
        borderWidth: 1,
        borderColor: 'white',
        marginTop: '4%',
        alignSelf: 'center',
        borderRadius: 10,
    }
})
